import React from 'react';
import logo from '../logo.svg';

const Projects = () => {
	return (
        <div>
            <header className="App-header">
                <p>
                Edit your life and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                    >
                    Learn Projects
                </a>
            </header>
        </div>
	);
};

export default Projects;
